@apkd Our apologies for the confusion.
The flights that are starting in April are between Calgary and London Gatwick. We're trying to get this corrected on our website.
Our flights between Gatwick and Toronto ended last month, and will not be resuming in the spring.

@RileyWaterloo Our apologies for the frustration you’re feeling.
We can assure you we are working 24/7 replying to all our guests.
If you need our help, please send us a direct message with your request, your full name, reservation code, where flew from and to and baggage reference number. https://t.co/o7MlHGd5Wh

@darrylklassen Thank you for connecting with us regarding your Air Passenger Protection Regulations (APPR) claim.
We regret your concerns cannot be addressed here, as we have a specialized team that processes them.
If you received an email from the APPR team, you're welcome to reply to it.
